import React from "react";
import Card from "./Card";
import contacts from "../contacts";

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card name={contacts[0].name} img="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg" tel="+12 122323" email="232@wew.cn"/>
      <Card name={contacts[1].name} img="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg" tel="+12 122323" email="232@wew.cn"/>
      <Card name={contacts[2].name} img="https://blackhistorywall.files.wordpress.com/2010/02/picture-device-independent-bitmap-119.jpg" tel="+12 122323" email="232@wew.cn"/>
    </div>
  );
}

export default App;
